import React from 'react';
import { Link } from 'react-router-dom';

const Header: React.FC = () => {
  return (
    <header className="bg-blue-800 text-white shadow-lg">
      <div className="container mx-auto px-4 py-4">
        <div className="flex justify-between items-center">
          <Link to="/" className="text-2xl font-bold">
            üåç African Nations League
          </Link>
          <nav className="flex space-x-6">
            <Link to="/" className="hover:text-blue-200 transition-colors">
              Home
            </Link>
            <Link to="/tournament" className="hover:text-blue-200 transition-colors">
              Tournament
            </Link>
            <Link to="/register" className="hover:text-blue-200 transition-colors">
              Register Team
            </Link>
            <Link to="/admin" className="hover:text-blue-200 transition-colors">
              Admin
            </Link>
          </nav>
        </div>
      </div>
    </header>
  );
};

export default Header;
